INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, 'People, Projects, Technology, OrganisationWe are business solutions specialists, assisting our clients to connect people to their projects...and their projects to their technology...their technology to their organisational processes...and their organisational processes back to their people.\r\n4impact has fast become recognised as one of Australia''s most trusted and respected services companies, assisting clients in Brisbane, Sydney, Melbourne and Canberra. 4impact delivers real improvements to your business performance through the implementation of strategy and the delivery of business and technology projects.  \r\nOur success is largely due to our single-minded focus to develop trusted and meaningful relationships with our client organisations to share knowledge, expertise and a passion to deliver measurable value.\r\nOur team comes from a varied background and has substantial experience in a wide range of industry sectors, and we recognise the different needs that varying sizes and scales of client organisations bring. \r\nOne size does not fit all.  Our delivery of projects across the ICT, financial services, government, infrastructure, property, mining and utilities sectors has taught us that all organisations have varying needs - different approaches and different benefits are derived from the different solution paths.\r\nWe believe that our experience can provide you with compelling value. We understand that you have to juggle competing interests and other pressures on a daily basis, all whilst trying to achieve real business outcomes. With such a complex array of problems to solve, we will help you navigate through the maze.\r\n\r\nWe are skilled at crafting simple and pragmatic solutions without fuss and bravado...we get on with it.\r\nThrough our innovation, we are not driven to conform to industry norms, methodologies and culture...we provide unique engagement models.\r\nWe are skilled at engaging with a community of partners when faced with a challenge...we bring end to end solutions together.\r\nOur capabilities span strategy to implementation to infrastructure.\r\n', '', 'full_html'),
('node', 'article', 0, 2, 2, 'und', 0, 'Nothing beats demonstrable industry experience where your supplier understands your problem and can provide people who have solved that problem before.\r\n4impact has a sound track record having worked across a number of different industries. When you partner with us you can rest assured that we have the necessary experience and expertise to deliver on time, and with measurable value.  Our ''mobile bench'' allows us to support your specific requirements in the most prompt and practical manner possible.  Our network reach to access culturally aligned experts is unparalleled.\r\n4impact works with the following industries:\r\nBanking & Insurance, Aviation, Oil & Gas, Utilities, Mining, Technology, Telecommunications, Leisure & Gaming & Manufacturing\r\nFederal, State and Local Government, GOC''s, Defence, Policing & Justice, Health, Education, Roads & Transport\r\nFor more information, please read our case studies below:\r\nHow we perform to win Our client had a Board of eight people and a Senior Management team of seven, who in the short life of the organisation (several years) had never taken time together to discuss roles and responsibilities and challenges each group faced...\r\nHow we perform to win 4impact were engaged to provide overall stewardship of the assignment, leveraging the clients’ significant internal resources and collateral. This approach enabled 4impact to provide leadership, insight and coordination, utilising...\r\nThe 4impact team was experienced in automation testing for software projects and brought with them a testing framework to underpin the tools and processes. The framework has two primary requirements, automation must be part of the project development deliverables...\r\nHow we perform to win 4impact helped drive to firstly identify the key business requirements which were; Network resilience, scalability and security. Additionally, by leveraging the agency cluster approach and deploying the latest in virtualisation technology,...\r\nHow we perform to win 4impact were asked to facilitate an outcome to break the deadlock and in discussions with the clients’ program manager it was decided to hold a series of short but sharp workshops with key players. A starting point was developed...\r\nHow we perform to win · Implementation of an ICT Governance Board: Senior Executive membership of the portfolio to administer and guide the portfolio of investments. · A complete audit of the 140 projects underway in the business and the assessment...\r\nHow we perform to win The ensuring project, valued at $22m, is phased over a three year period with the first phase centred on procuring an externally provided solution through a competitive tendering process. The organisation has opted for an enterprise data...\r\nThe Problem The Company’s legacy applications presented a commercial dilemma, costly to maintain or replace, no substantial local development capability, increasing gap to competitor products, inability to scale legacy systems and global IT infrastructure...\r\nHow we perform to win Our highly scalable approach has been tested within national and state-wide businesses that transcend the boundaries of multiple business units. As a project outcome, our strategy and architecture approach facilitated the development...', '', 'full_html'),
('node', 'abc', 0, 3, 3, 'und', 0, 'At 4impact, our day job is to help people get where they want to go. We help them manage their careers, to deliver first class results for clients, and we love making things happen for people and organisations throughout Australia. But we want to leave a far wider legacy, one with real impact on people around the world: \r\n\r\nThrough our partnership with Opportunity International we contribute a portion of our daily consulting fees to their micro-finance programs. These funds are used to start businesses for the poor in developing countries.\r\n\r\nIt takes just a small amount to start a business and provide someone a job that will permanently lift them and their family out of poverty. We passionately believe in this as it will be our lasting impact on the world long after we are gone. We have some big goals that you can help us with.', '', 'filtered_html'),
('node', 'abc', 0, 4, 4, 'und', 0, '\r\n4impact is your trusted partner in solving complex people, project, technology and organisation challenges. We draw on expertise across these four areas (our four impacts) to deliver simple, workable solutions.\r\n\r\nWith 4impacters ''on the ground'' in Brisbane, Sydney, Melbourne and Canberra, we are renowned for our ability to deliver solutions using the best people who:\r\nare skilled at determining why complex issues exist, their interaction and context\r\nknow and appreciate what is involved in addressing people, project, technology and organisational challenges\r\nunderstand how to craft simple, demonstrable and proven solutions to these challenges, and\r\nknow when  to apply these solutions in a manner which delivers the ultimate, and sustainable, impact through value and benefits', '', 'filtered_html'),
('node', 'abc', 0, 5, 5, 'und', 0, 'sfd', '', 'filtered_html'),
('node', 'abc', 0, 6, 7, 'und', 0, 'may-bay-1-1373239452_500x0.jpg\r\nCột khói bốc lên từ chiếc máy bay Boeing 777 của hãng Asiana sau khi nó lao xuống sân bay quốc tế San Francisco tại Mỹ hôm 6/7. Ảnh: AP.\r\nBà Deborah Hersman, người đứng đầu Ủy ban An toàn Giao thông quốc gia Mỹ, đã cung cấp thông tin cho các phóng viên về chuyến bay 214 của hãng hàng không Asiana, AP đưa tin. Bà tuyên bố các chuyên gia đã phân tích dữ liệu trong hai hộp đen của máy bay. Dữ liệu trong một hộp đen cho thấy ai đó từ sân bay quốc tế San Francisco đã kêu gọi các phi công hủy hành động hạ cánh khoảng 1,5 giây trước khi tai nạn xảy ra.\r\n\r\n"Lúc ấy chiếc Boeing 777 đang di chuyển với tốc độ dưới 250 km/h - mức vận tốc cần thiết để máy bay hạ cánh. Đúng 1,5 giây trước cú va chạm, ai đó đã yêu cầu các phi công hủy hạ cánh vì phi cơ không đạt tới tốc độ cần thiết để đáp xuống. Tốc độ của chiếc Boeing 777 đã tăng ngay trước khi nó chạm đất", bà Hersman nói.', '', 'full_html');
