INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' about people projects technology organisationwe are business solutions specialists assisting our clients to connect people to their projects and their projects to their technology their technology to their organisational processes and their organisational processes back to their people 4impact has fast become recognised as one of australia s most trusted and respected services companies assisting clients in brisbane sydney melbourne and canberra 4impact delivers real improvements to your business performance through the implementation of strategy and the delivery of business and technology projects our success is largely due to our singleminded focus to develop trusted and meaningful relationships with our client organisations to share knowledge expertise and a passion to deliver measurable value our team comes from a varied background and has substantial experience in a wide range of industry sectors and we recognise the different needs that varying sizes and scales of client organisations bring one size does not fit all our delivery of projects across the ict financial services government infrastructure property mining and utilities sectors has taught us that all organisations have varying needs different approaches and different benefits are derived from the different solution paths we believe that our experience can provide you with compelling value we understand that you have to juggle competing interests and other pressures on a daily basis all whilst trying to achieve real business outcomes with such a complex array of problems to solve we will help you navigate through the maze we are skilled at crafting simple and pragmatic solutions without fuss and bravado we get on with it through our innovation we are not driven to conform to industry norms methodologies and culture we provide unique engagement models we are skilled at engaging with a community of partners when faced with a challenge we bring end to end solutions together our capabilities span strategy to implementation to infrastructure  ', 0),
(2, 'node', ' industry experience nothing beats demonstrable industry experience where your supplier understands your problem and can provide people who have solved that problem before 4impact has a sound track record having worked across a number of different industries when you partner with us you can rest assured that we have the necessary experience and expertise to deliver on time and with measurable value our mobile bench allows us to support your specific requirements in the most prompt and practical manner possible our network reach to access culturally aligned experts is unparalleled 4impact works with the following industries banking insurance aviation oil gas utilities mining technology telecommunications leisure gaming manufacturing federal state and local government goc s defence policing justice health education roads transport for more information please read our case studies below how we perform to win our client had a board of eight people and a senior management team of seven who in the short life of the organisation several years had never taken time together to discuss roles and responsibilities and challenges each group faced how we perform to win 4impact were engaged to provide overall stewardship of the assignment leveraging the clients significant internal resources and collateral this approach enabled 4impact to provide leadership insight and coordination utilising the 4impact team was experienced in automation testing for software projects and brought with them a testing framework to underpin the tools and processes the framework has two primary requirements automation must be part of the project development deliverables how we perform to win 4impact helped drive to firstly identify the key business requirements which were network resilience scalability and security additionally by leveraging the agency cluster approach and deploying the latest in virtualisation technology how we perform to win 4impact were asked to facilitate an outcome to break the deadlock and in discussions with the clients program manager it was decided to hold a series of short but sharp workshops with key players a starting point was developed how we perform to win implementation of an ict governance board senior executive membership of the portfolio to administer and guide the portfolio of investments a complete audit of the 140 projects underway in the business and the assessment how we perform to win the ensuring project valued at 22m is phased over a three year period with the first phase centred on procuring an externally provided solution through a competitive tendering process the organisation has opted for an enterprise data the problem the company s legacy applications presented a commercial dilemma costly to maintain or replace no substantial local development capability increasing gap to competitor products inability to scale legacy systems and global it infrastructure how we perform to win our highly scalable approach has been tested within national and statewide businesses that transcend the boundaries of multiple business units as a project outcome our strategy and architecture approach facilitated the development  ', 0),
(3, 'node', ' comunication at 4impact our day job is to help people get where they want to go we help them manage their careers to deliver first class results for clients and we love making things happen for people and organisations throughout australia but we want to leave a far wider legacy one with real impact on people around the world through our partnership with opportunity international we contribute a portion of our daily consulting fees to their microfinance programs these funds are used to start businesses for the poor in developing countries it takes just a small amount to start a business and provide someone a job that will permanently lift them and their family out of poverty we passionately believe in this as it will be our lasting impact on the world long after we are gone we have some big goals that you can help us with abccom  ', 0),
(4, 'node', ' gsdgsd 4impact is your trusted partner in solving complex people project technology and organisation challenges we draw on expertise across these four areas our four impacts to deliver simple workable solutions with 4impacters on the ground in brisbane sydney melbourne and canberra we are renowned for our ability to deliver solutions using the best people who are skilled at determining why complex issues exist their interaction and context know and appreciate what is involved in addressing people project technology and organisational challenges understand how to craft simple demonstrable and proven solutions to these challenges and know when to apply these solutions in a manner which delivers the ultimate and sustainable impact through value and benefits xczcxzxc giai tri ', 0),
